ControlPropertyState.AutoRuleBindingString:
ClearCollect(
    CollDayScanReport,
    Filter(
        ScanReports,
        ScanReportDate = Value(
            Text(
                DatePicker1_1.SelectedDate,
                "yyyymmdd"
            )
        )
    )
);
ClearCollect(
    CollDayScanClassGroup,
    Distinct(
        CollDayScanReport,
        DayScanClass
    )
);
Set(ReportTime, Text(Now(), "hh:mm am/pm"));

If(
    // Case 1: nothing selected in combo box
    IsBlank(varSelectedStudent) || IsBlank(varSelectedStudent.cree6_idname),
    "No student selected",

    // Case 2: show most recent scan for this student
    With(
        {
            lastScan: First(
                Sort(
                    Filter(
                        Student_Scans,
                        Student_QR = varSelectedStudent.cree6_idname
                    ),
                    'Created On',
                    SortOrder.Descending
                )
            )
        },
        If(
            IsBlank(lastScan),
            "No activity recorded",
            If(
                lastScan.ScanType = "Check In",
                "✅ Last Check In: " & 
                    Text(DateAdd(lastScan.'Created On', TimeZoneOffset(), "Minutes"), "mm/dd/yyyy hh:mm AM/PM"),
                "🚪 Last Check Out: " & 
                    Text(DateAdd(lastScan.'Created On', TimeZoneOffset(), "Minutes"), "mm/dd/yyyy hh:mm AM/PM") &
                    ", Picked up by " & Coalesce(lastScan.PickUpPerson, "Unknown")
            )
        )
    )
)
